import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Logo() {
  const [logoData, setLogoData] = useState([]);

  useEffect(() => {
    document.title = 'Logo';

    return () => {
      document.title = 'Default Title';
    };
  }, []);

  useEffect(() => {
    axios.get('http://localhost:9000/api/list')
      .then((response) => {
        console.log('Data received:', response.data);
        setLogoData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      {logoData.map((item, index) => (
        <div key={index}>
          <button className="my_profile_img_button">
            <img alt="" src={`data:image/jpg;base64, ${item.list_icon}`}/>
            {/* <img id="my_profile_img" alt="" src={`data:image/jpg;base64, ${item.profile_img}`} onClick={toggleDropdown} /> */}
          </button>
          <div>
            <ul>
          {Object.keys(item).map((key) => (
            <p key={key}>{item[key]}</p>
          ))}
          </ul>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Logo;
